-- ----------------------------
-- Table structure for t_member
-- ----------------------------
DROP TABLE IF EXISTS `t_member`;
CREATE TABLE `t_member` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '自增主键',
  `mtype` int(11) NOT NULL COMMENT '账号类型(1：手机号，2：微信号，3：QQ号，4：新浪微博)',
  `loginName` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '用户账号',
  `loginPass` varchar(32) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '用户密码(MD5加密长32位)',
  `realName` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '真实姓名',
  `nickName` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `photo` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `createTime` bigint(20) DEFAULT NULL COMMENT '创建时间',
  `sex` int(11) DEFAULT '2' COMMENT '性别（0：女；1：男；2：保密）',
  `tel` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `store` bigint(20) DEFAULT NULL COMMENT '用户积分',
  `level` int(11) DEFAULT NULL COMMENT '用户等级',
  `email` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '电子邮箱',
  `loginCount` bigint(20) DEFAULT '0' COMMENT '登录次数',
  `lastLoginIp` varchar(15) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '最后登录IP',
  `lastLoginTime` bigint(20) DEFAULT NULL COMMENT '最后登录时间',
  `lastLoginLocation` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '最后登录地址',
  `remark` text COLLATE utf8_unicode_ci COMMENT '备注',
  `fromSite` bigint(20) DEFAULT NULL COMMENT '站点来源',
  `vipFlag` int(11) DEFAULT NULL COMMENT '是否会员',
  `idCardNum` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '身份证号',
  `idCardImgs` text COLLATE utf8_unicode_ci COMMENT '身份证电子件',
  `licenseNum` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '执照编码',
  `licenseImgs` text COLLATE utf8_unicode_ci COMMENT '执照电子版',
  `certFlag` int(11) DEFAULT '0' COMMENT '证书类型(0：未认证，1：个人认证，2：企业认证)',
  `auditFlag` int(11) DEFAULT '0' COMMENT '审核状态(0:未审核，1：审核通过，-1：审核未通过）',
  `thirdInfo` text COLLATE utf8_unicode_ci COMMENT '第三方登录信息',
  `bindId` bigint(20) DEFAULT NULL COMMENT '绑定登录账号',
  `modified` text COLLATE utf8_unicode_ci COMMENT '手动修改过的字段',
  `state` int(11) DEFAULT '0',
  `shopCount` int(11) DEFAULT '0' COMMENT '已开通店铺数',
  PRIMARY KEY (`id`),
  UNIQUE KEY `loginname_index` (`mtype`,`loginName`)
) ENGINE=InnoDB AUTO_INCREMENT=2011 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci ROW_FORMAT=DYNAMIC COMMENT='客户信息表';

